import axios from 'axios';
import React, { Component } from 'react';

class WineBars extends Component {
    constructor(props){
        super();
        this.state = {
            data: [],
            zipCode: '94109'
        }
    }
    componentDidMount(){
        axios.get("/winebars", {params: { zipCode: this.state.zipCode} })
        .then((response) => {
            this.setState({data: response.data})
            if(this.state.data.hasOwnProperty("businesses")){
                // console.log(this.state.data.businesses);

            Object.entries(this.state.data.businesses).map(([key, value], i) => {
                console.log(value);
                console.log(value.name);
                console.log(value.display_phone);
                console.log(value.location.display_address.join("\n"));
            })
        }

        })
        .catch((error) => {
            console.log(error);
        })
    }

    render() {
        return (
            <div>
                {this.state.data.hasOwnProperty("businesses") &&

                 Object.entries(this.state.data.businesses).map(([key, value], i) => {
                     <div key={value.id}>
                         <h1>{value.name}</h1>
                         <p>{value.display_phone}</p>
                         <p>{value.location.display_address.join("\n")}</p>
                    </div>
                })

                }
            </div>
        );
    }
}

export default WineBars;
